items.description:
Продам или сдам 3-х комнатную квартиру в панельном доме на 5 этаже, в тихом спальном районе. Квартира чистая, очень тёплая.
Квартира с евроремонтом: 
- стеклопакеты;
- межкомнатные двери;
- качественная входная дверь;
- ламинат в комнате.
- кафель в ванной.
- полная замена электропроводки;
- установлены счетчики на горячую и холодную воду;
- теплый пол в ванной комнате.
Частично с мебелью и техникой. Рядом магазины, садик, недалеко от дома школа № 5, Мед колледж, академия. 
